import React, {useEffect, useState} from "react";
import axios from "axios";
function Product() {
    const [products, setProducts] = useState([]);
    useEffect(() => {
        const productsURL = process.env.REACT_APP_PRODUCTS_DATABASE;
        axios.get(productsURL).then(res => res.json()).then(data => {
            setProducts(data);
        }).catch(err => err);
    }, [])
    return (
        <div>
            {JSON.stringify(products)}
        </div>
    )
}

export default Product;
